        const parkingDetail = this.state.parkingDetail

        if(this.state.parkingDetail){

            parking = (
                <div className="DetailParking">
                    <div className="DetailParking__wrapper">
                        <div className="title">
                        <p className="parking__name">{parkingDetail.name}</p>
                        </div>
                        <Card>
                            <Carousel className="carousel__box">
                                    <div className="carousel__images" >
                                        <img  src={parkingDetail.image} alt="img" />
                                    </div>
                                    <div>
                                        <img  src={parkingDetail.image} alt="img" />
                                    </div>
                                    <div>
                                        <img  src={parkingDetail.image} alt="img" />
                                    </div>
                            </Carousel>
                        </Card>



                        <Paper>
                            <h3>{parkingDetail.location}</h3>
                            <h3>{parkingDetail.type}</h3>

                        </Paper>
                        <SlotCount />
                        <OperationTimings />

                        </div>
                    </div>

            );
        }
        return parking
    }
}
export default ParkingDetails;
